class ContextProvider extends Component {
  constructor(props) {
    super(props);

    this.state = {
      filters: {
        active: true,
        headerActive: false,
      },
    };
  }

  render() {
    const { value } = this.props;
    return (
      <Context.Provider value={value}>{this.props.children}</Context.Provider>
    );
  }
}

export default ContextProvider;
